Weezer is a Grammy nominated American rock band from Los Angeles, California formed in 1992 by Rivers Cuomo (lead vocals, guitar), Patrick Wilson (drums, backing vocals), Matt Sharp (bass, backing vocals), and Jason Cropper (guitar, backing vocals), with the last two replaced by Mikey Welsh and Brian Bell, respectively. Mikey Welsh was later replaced with Scott Shriner.[1] They have released five full-length albums, three EPs, and a DVD; the first album was later re-released as a remastered deluxe edition. Their most recent album, Make Believe, was released on May 10, 2005. Weezer is currently completing work on their sixth album, due for release on June 3, 2008. They have sold more than 7 million records to date in the US alone.





